        public static IEnumerable<string> LongText(string originalText)
        {
            string text = originalText;
            if (originalText != "0")
            {
                text = VeryLongText;
            } 
            const int maxCharacterCount = 32000;
            List<string> result = new List<string>();

            int count = text.Length / maxCharacterCount + 1;
            for (int i = 0; i < count; i++)
            {
                int itemLength = Math.Min(maxCharacterCount, text.Length - i * maxCharacterCount);
                string item = text.Substring(i * maxCharacterCount, itemLength);
                result.Add(item);
            }

            return result;
